// src/App.js
import React from 'react';
import './App.css';
import ModelList from './ModelList'; // Ensure this matches your file structure

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>3D Model Store</h1>
      </header>
      <main>
        <ModelList />
      </main>
    </div>
  );
}

export default App;
